var json = {"status":0,"data":{"childList":[{"childList":[],"_id":"5ae7e55bbd32e6000442c24e","name":"Electric Field","text":"<div style=\"text-align: justify;\"><font color=\"#000000\" face=\"Open Sans, sans-serif\"><span style=\"font-size: 14px;\">Electric field is a force produced by a charge near its surroundings. This force is exerted on other charges when brought in the vicinity of this field.&nbsp;<span style=\"display: inline !important;\">SI unit of electric field is N/C (Force/Charge).&nbsp;</span><span style=\"display: inline !important;\">Electric field due to a charge at a point is the force that a unit positive charge would experience if placed at that point.</span></span></font></div><div style=\"text-align: justify;\"><font color=\"#000000\" face=\"Open Sans, sans-serif\"><span style=\"font-size: 14px;\">The charge generating electric field is called source charge and the charge which experiences this field is called test charge. Practically, to keep source charge undisturbed due to the electric field of test charge, the test charge is kept infinitely small.</span></font></div><div style=\"text-align: justify;\"><font color=\"#000000\" face=\"Open Sans, sans-serif\"><span style=\"font-size: 14px;\">Since F(Force) is proportional to q (Charge), the electric field is independent of q but depends on r (space coordinates).</span></font></div><div style=\"text-align: justify;\"><font color=\"#000000\" face=\"Open Sans, sans-serif\"><span style=\"font-size: 14px;\">The electric field is symmetric in spherical coordinates.</span></font></div><div style=\"text-align: justify;\"><font color=\"#000000\" face=\"Open Sans, sans-serif\"><span style=\"font-size: 14px;\">The concept of Electric field is used to account for the time delay for a charged body to experience force from the field of a source charge</span></font></div>"},{"childList":[{"contentList":[],"childList":[],"_id":"5ae7e73fbd32e6000442c257","name":"Electric Flux","text":"Electric flux is the measure of flow of the electric field through a given area. Electric flux is proportional to the number of electric field lines going through a normally perpendicular surface.<br><div><img src=\"data:image/jpeg;base64,\"><br></div>"}],"_id":"5ae7e57cbd32e6000442c250","name":"Electric Field Lines","text":"<img src=\"data:image/jpeg;base64,\"><div><div>Electric field lines are a pictorial way of representing electric field around a configuration of charges.</div><div><br></div><div>An electric field line is a curve drawn in such a way that the tangent to it at each point is in direction of the net field at that point.</div><div>Electric field is inversely proportional to the square of the distance; hence electric field near the charge is high and keeps on decreasing as we go farther from the charge. The electric field lines, however, remain constant but are very far apart (at higher distances) as compared to lesser distance.</div><div><br></div></div>"}]}}

